(1, -1, 1, 'Principal', 213, '1', '1', 0, 1, 'root', 'frontpage4', 'catalog_frontpage_headline_shop_BR|', '|Gerar um código Habbo aqui:|'),
(3, -1, 100, 'Classic Furni', 2, '0', '0', 0, 1, 'xerameucu', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(4, -1, 100, 'Loja de Pixels', 178, '0', '0', 0, 1, '', 'info_duckets', 'duckets_header|', '<i><b><font color=\"#591d97\" size=\"16\">O que são os Duckets?</font></b></i><br><br>Os Duckets são uma moeda virtual gratuita que você pode ganhar todos os dias por jogar o Habbo Hotel.<br><br><i><b><font color=\"#591d97\" size=\"16\">Para que servem?</font></b></i><br><br><li>Descole um <a href=\"event:catalog/open/duckets_badge\">Emblema</a> Exclusivo.</li><li>Consiga <a href=\"event:catalog/open/duckets_furnis\">mobílias incríveis</a>.</li><li>Qualquer negócio divertido que a gente inventar.</li><br><i><b><font color=\"#591d97\" size=\"16\">Como ganho uns Duckets?</font></b></i><br><br><li>Entre diariamente! Quanto mais ativo, mais chances de ganhar.</li><li>Você ganha por cada conquista como <a href=\"event:talent/open/citizenship\">Cidadão Habbo</a>.</li><li>Qualquer surpresa que a gente inventar!</li>|'),
(5, 912392, 1, 'Habbo Club', 172, '1', '1', 0, 1, 'habbo_club', 'vip_buy', 'hc2_clubtitle|clubcat_pic', ''),
(6, 912437, 999, 'Eventos 2', 1, '1', '1', 1, 5, '', 'default_3x3', 'vipheader1|vipteaser2', 'Thank you for purchasing VIP! This section of the catalogue is especially for our VIP users. The Rares in this section aren\'t cheap, but you can sell them on to non VIP members for a much heftier price!|Click on an item for more information.'),
(7, 912455, 1, 'Buy Club', 75, '1', '1', 0, 5, '', 'default_3x3', 'habboclub|catalog_hc_teaser', 'Habboon club comes with many bonuses! More hair and clothes choices, more hair and clothes colours to come from, new room layouts, new dances, and much, much more!|'),
(8, 912409, 26, 'HC Club', 172, '1', '0', 0, 1, 'hcclub', 'default_3x3', 'catalog_header_hc|teaser_habboclub', 'Deixe que esses elegantes pixels repousem em seus Quartos, dando mais sofisticação a tudo. Eles combinam com seus Mobis HC mensais grátis.||Apenas para membros do Habbo Club|'),
(9, 912409, 28, 'Bots', 65, '1', '1', 0, 1, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', 'Adquira já o seu Bot, eles falam, andam e dão estilo e graça a qualquer quarto!|Escolha o seu bot! Obs.: Você poderá personalizar o seu bot quando ele estiver no seu quarto'),
(11, 912420, 1, 'Minhas vendas', 70, '1', '1', 0, 1, '', 'marketplace_own_items', '', ''),
(12, 912420, 2, 'Ofertas', 71, '1', '1', 0, 1, 'marketplace_offers', 'marketplace', '', ''),
(13, 912409, 1, 'Habbo Câmbios', 146, '1', '1', 0, 1, 'coins_page', 'default_3x3', 'catalog_bank_headline1_br|catalog_bank_teaser', 'Troque suas Moedas por Câmbios, seus Câmbios por Mobis, seus Mobis por Câmbios.'),
(14, 912391, 1, 'Mascotes', 8, '1', '1', 0, 1, 'pets', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Mascotes são habitantes do Habbo Hotel e, assim como seus donos, precisam de alguns cuidados essenciais.|Algumas coisas que você deve saber:|- Você pode colocar um Mascote no seu Quarto ou passear com ele em outros Quartos.\r\n- Você não pode negociar Mascotes, mas eles podem ir ao Quarto dos seus amigos para ganhar carinho\r\n- Você pode ter no máximo 50 Mascotes no seu Quarto, mas cuide bem de todos!\r\n- Confira as necessidades dele, como água, comida e brinquedos. Veja a seção Para Mascotes.\r\n- Ganhe Emblemas de Conquista treinando seu Mascote|- Seu Mascote fica velho, mas não morre.\r\n- Você não pode negociar seu Mascote.'),
(15, 912413, 8, 'Decoração', 225, '1', '1', 0, 1, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1_br|', 'Papel de parede, pisos e vistas - crie vários ambientes usando combinações diferentes. Veja uma prévia de como vai ficar o Quarto antes de comprar.|Escolha um item|'),
(16, 912455, 5, 'Edição Limitada de Raros', 145, '1', '1', 0, 5, 'ultd_furni', 'default_3x3', 'limited_header|', 'Adquira enquanto há tempo! Edição Limitada de Raros só está disponível em quantidades limitadas. Uma vez que todas forem vendidas, acabou! Cada Mobi pode ser identificado pelo ID e o LTD logo abaixo deles.|'),
(18, -1, 100, 'New Furni', 2, '0', '0', 0, 1, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(24, 912413, 7, 'Janelas', 218, '1', '1', 0, 1, '', 'default_3x3', 'ctlg_windows_headline1_pt|ctlg_windows_teaser1_en', 'Deixe o sol entrar! Tire o mofo do seu Quarto com uma Janela. Quem disse que você não pode ter uma vista?||'),
(26, 912412, 6, 'Iluminação', 40, '1', '1', 0, 1, '', 'default_3x3', 'catalog_dimmers_header1_br|catalog_dimmer_teaser_en', 'Mude as luzes do seu Quarto de acordo com seu dia, humor, temperatura, gosto.\r\nUma brincadeira para quem não tem medo do escuro.|Clique no item para ver detalhes'),
(27, 912389, 145, 'Natalinos', 90, '1', '1', 0, 1, 'old_xmasback', 'default_3x3', 'catalog_header_xmas15|catalogue_teaser_newfurnixmas15', 'Uma explosão do passado: os mobis de Natal do passado fizeram sua aparição na Habbo Loja...Adquira-os enquanto você pode!||'),
(28, 912389, 13, 'Árticos', 13, '1', '1', 0, 1, '', 'default_3x3', 'catalog_arc_header1_en|catalog_arc_teaser1_en', 'Stay cool (or warm with our campfire!) and create your own Winter Wonderland or Humble Homeland for your penguins.|'),
(29, 912389, 200, 'Teleportes', 120, '1', '1', 0, 1, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Take your room to a whole new level with our range of space age teleporters! Just buy a pair, put one in each room and voila! You\'ll have two linked rooms!|'),
(30, 912389, 135, 'Modes', 39, '1', '1', 0, 1, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.|'),
(31, 912389, 48, 'Doce Rosa', 19, '1', '1', 0, 1, '', 'default_3x3', 'catalog_candy_headline1|catalog_candy_teaser1', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' category!|'),
(32, 912389, 169, 'Pura', 48, '1', '1', 0, 1, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Habboon Hotel.|'),
(33, 912389, 12, 'Área', 14, '1', '1', 0, 1, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'A chunky and sofisticated line for the down-to-earth, studious Habboon. Its simplicty is beautful and will add a welcoming charm to every room.|'),
(34, 912389, 43, 'Campo', 21, '1', '1', 0, 1, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!|'),
(35, 912389, 186, 'Rústicos', 37, '1', '1', 0, 1, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.|'),
(36, 912455, 170, 'Plásticos', 46, '1', '1', 0, 5, '', 'default_3x3_color_grouping', 'catalog_plasto_headline1|', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!|'),
(38, 912389, 27, 'Banheiro', 17, '1', '1', 0, 1, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!|'),
(39, 912414, 2, 'Plantas', 220, '1', '1', 0, 1, '', 'default_3x3', 'catalog_plants_headline1_br|catalog_plants_teaser1', 'Todo Quarto precisa de uma Planta para melhorar a qualidade do ar! Além de ser um presente bastante original...||'),
(40, 912413, 4, 'Tapetes', 116, '1', '1', 0, 1, '', 'default_3x3', 'catalog_rugs_headline1_br|catalog_rugs_teaser1|catalog_special_txtbg2', 'Para todas as ocasiões. Não faça feio na frente das visitas!||Este combina com meu\r\nQuarto!'),
(41, 912413, 3, 'Paredes', 122, '1', '1', 0, 1, '', 'default_3x3', 'catalog_walls_header_dyn|catalog_walls_teaser2_001', 'Era uma casa, muito engraçada... mas tinha parede!|Clique no item\r\npara ver detalhes.|'),
(43, 912389, 11, 'Acessórios', 11, '1', '1', 0, 1, '', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', 'Além dos outros Mobis básicos, estes aqui dão a sua cara ao Quarto. Depois você pode trocar tudo de lugar quando der na telha.||'),
(45, -1, 100, 'Rentals', 44, '0', '0', 0, 1, '', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Hire some cool effects to add an explosive touch to your room. From bubbles to firestarters, you can enhance your room dramatically!|'),
(46, 912455, 1, 'Presentes do Clube 2016', 214, '1', '1', 0, 5, 'club_gifts', 'default_3x3', 'catalog_header_habboclub|hc_catalog_teaser', 'Veja os novos presentes HC! Se você for HC, escolha entre a seleção de presentes HC.'),
(47, 912415, 9, 'Base', 179, '1', '1', 0, 5, 'duckets_basefurnis', 'default_3x3', 'catalog_header_base|base_rentable_teaser', 'Essa linha colorida de Mobis tem tudo o que você precisa para deixar seu Quarto no style e construir espaços incríveis.|Clique em um item\r\npara ver detalhes.|'),
(48, 912389, 199, 'Spa', 211, '1', '1', 0, 1, '', 'default_3x3', 'catalog_header_spa|catalog_teaser_spa', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Habboon Health Spa relaxing retreat! Robe and slippers not included.'),
(49, 912389, 198, 'Shakespeare', 59, '1', '1', 0, 1, '', 'default_3x3', 'catalog_shakespeare_header|catalog_shakespeare_teaser', 'You can be the world\'s most famous poet! All you need to do is purchase the furniture below, be amazing at speaking and drink tea!'),
(52, 912412, 10, 'Mostruário de Emblemas', 224, '1', '1', 0, 1, '', 'badge_display', 'catalog_header_badgedisplay|badgedisplay_promo2', 'Você deu duro para descolar seus Emblemas, né? Agora é a hora de mostrá-los!\r\nDescole um mostrador no Catálogo e escolha seus melhores Emblemas.||'),
(53, 912409, 3, 'Eventos', 55, '1', '1', 0, 1, 'room_ad', 'roomads', 'events_header|', '||'),
(55, 912389, 71, 'Gelados', 13, '1', '1', 0, 1, '', 'default_3x3', 'catalog_iced_headline1|catalog_iced_teaser1', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!|'),
(56, 912389, 15, 'Alhambra', 12, '1', '1', 0, 1, '', 'default_3x3', 'catalog_alh_headline1_en|dining_area_illustration', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!|'),
(57, 912389, 14, 'Ásiaticos', 15, '1', '1', 0, 1, '', 'default_3x3', 'catalog_asian_headline1|catalog_asian_teaser1', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!|'),
(58, 912389, 32, 'Bensalem', 18, '1', '1', 0, 1, '', 'default_3x3', 'catalog_lc_headline2_en|catalog_lc_teaser1_en_001', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, coral, and mythical sea creatures!|'),
(60, 912389, 54, 'Executivos', 27, '1', '1', 0, 1, '', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser_en', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?|'),
(61, 912389, 186, 'Vidro', 29, '1', '1', 0, 1, '', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!|'),
(62, 912389, 70, 'Góticos', 30, '1', '1', 0, 1, '', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!|'),
(64, 912389, 12, 'Arte na Rua', 32, '1', '1', 0, 1, '', 'default_3x3', 'catalog_grunge_headline1|catalog_gru_teaser_en', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!|'),
