(9223, 9036, 2, 'Fórum de Grupo', 207, '1', '1', 0, 1, 'guild_forum', 'guild_forum', '', 'Os Fóruns de Grupo chegaram!|<<i><b><font color=\"#0e3f52\" size=\"16\">O que são Fóruns de Grupo?</font></b></i>\r\n\r\nCom os Fórums você pode escrever uma mensagem, fazer comentários e discutir tópicos facilmente, sem ter que sair do Hotel!\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Quem pode abrir um fórum?</font></b></i>\r\n\r\nSomente um membro do grupo pode criar um fórum para seu grupo.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Preciso de um Mobi Terminal de Fórum?</font></b></i>\r\n\r\nSim - Para criar um fórum de grupo, o dono do mesmo precisa adquirir um terminal para esse grupo.\r\n\r\nSaiba mais sobre o Fórum de Grupos <a href=\"event:habbopages/forums\">aqui</a>.\r\n\r\nNotinha camarada: continuaremos adicionando novidades e mais funcionabilidades'),
