(912415, 912393, 24, 'Loja de Duckets', 178, '1', '1', 0, 5, 'duckets', 'info_duckets', 'duckets_header|duckets_info_illustration', '<i><b><font color=\"#591d97\" size=\"16\">O que são os Duckets?</font></b></i><br><br>Os Duckets são uma moeda virtual gratuita que você pode ganhar todos os dias por jogar o Habbo Hotel.<br><br><i><b><font color=\"#591d97\" size=\"16\">Para que servem?</font></b></i><br><br><li>Consiga <a href=\"event:catalog/open/duckets_basefurnis\">mobílias incríveis</a>.</li><li>Promova <a href=\"event:catalog/open/room_ad\">Eventos</a>.</li><li>Qualquer negócio divertido que a gente inventar.</li><br><i><b><font color=\"#591d97\" size=\"16\">Como ganho uns Duckets?</font></b></i><br><br><li>Entre diariamente! Quanto mais ativo, mais chances de ganhar.</li><li>Você ganha por cada conquista como Cidadão.</li><li>Qualquer surpresa que a gente inventar!</li>|'),
