(912418, 912409, 27, 'Wired', 80, '1', '0', 0, 1, 'category_wired', 'pets3', 'catalog_wired_header1|ctlg_pic_teaser_wired', 'Mobis Wired lhe dão infinitas possibilidades- você pode programar seus Mobis para fazerem qualquer coisa aprendendo a utilizar os Ativadores, Efeitos e Condições.|Como funciona?|Para tornar seu Quarto Wired você precisa conhecer os Mobis:\r\n\r\n1. Ativadores: coisas que você precisa fazer para um Efeito funcionar.\r\n\r\n2. Efeitos: coisas que acontecem quando você liga   um Ativador.\r\n\r\n3. Condições (opcionais): as condições necessárias para o Ativador funcionar.\r\n\r\n\r\n\r\n\r\n\r\n\r\nCada um destes pode ser programado separadamente. Empilhe seu Ativador com os Efeitos e Condições e eles transformarão o seu Quarto.|'),
(912419, 912409, 29, 'Jogos', 202, '1', '0', 0, 1, 'games', 'pets3', 'game_shop_header|game_shop_teaser', 'Há muitos jogos no gatilho... Preparado?|Escolhe o seu jogo!|\r\nDê uma olhada no menu de Esportes e decida qual vai tentar primeiro. Freeze, Battle Banzai, Hóquei ou Futebol. Seja qual for o seu esporte, junte seus amigos e mostre ao mundo sua habilidade!|Não se esqueça: alguns jogos precisam de equipamentos e Mobis para que funcionem!'),
(912420, 912409, 32, 'Feira Livre', 69, '1', '1', 0, 1, 'marketplace', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'Feira Livre é um jeito fácil e seguro de vender seus Raros no Habbo.|Como a Feira Livre funciona?|Para vender raros: Você pode vender qualquer raro do seu inventário marcado como permitido. Basta selecionar o item no Inventário e clicar no botão \"Vender na Feira Livre\".\r\n\r\nPara adquirir raros: Procure pelo que você quer comprar na página de ofertas da Feira Livre e clique em Adquirir. Garantimos que você vai receber o item pelo preço anunciado na mesma hora da compra!\r\n\r\nErros ou algo que você ache que não é correto? Reporte para um de nossos membros da Staff!|'),
(912421, 912391, 2, 'Filhotes de Mascotes', 228, '1', '1', 0, 1, 'babypets_shop', 'pets3', 'babypets_cata_header|ctlg_babypet_note', 'Eles são amigos, fofos, uma doçura! De quem estamos falando? Dos filhotinhos de mascotes! NOVOS gatinhos, cachorrinhos e porquinhos estão invadindo nosso Hotel e enchendo-o de carinho, junto aos ursinhos e terriers.|Algumas coisas que você deve saber:|- Você pode colocar um Mascote no seu Quarto ou passear com ele em outros Quartos.\r\n- Você não pode negociar Mascotes, mas eles podem ir ao Quarto dos seus amigos para ganhar carinho\r\n- Você pode ter no máximo 50 Mascotes no seu Quarto, mas cuide bem de todos!\r\n- Confira as necessidades dele, como água, comida e brinquedos. Veja a seção Para Mascotes.\r\n- Ganhe Emblemas de Conquista treinando seu Mascote|- Seu Mascote fica velho, mas não morre.\r\n- Você não pode negociar seu Mascote.'),
(912423, 912392, 7, 'Bloco-a-Bloco', 28, '1', '1', 0, 1, 'blockwithblock', 'pets3', 'block_header|ctlg_bclub_note', 'Com Bloco-a-Bloco a gente pode construir qualquer coisa, que tal testar?|1 Bloco... 2 Blocos... Bloco vermelho... Bloco azul!|\nCom milhares de novas cores e formas para escolher, você pode deixar sua criatividade fluir livremente!\nExclusivo para o Clube do Arquiteto.||'),
