(912442, 912419, 2, 'Como jogar Banzai', 42, '1', '1', 0, 1, '', 'pets2', 'catalog_battleBanzai_header_en|catalog_battleBanzai_teaser', 'Então como funciona? Leia as regras aqui e não perca tempo na hora de começar seu Banzai!|Como criar sua Arena Battle Banzai|1. Vá ao seu Quarto.\r\n2. Coloque os Pisos Banzai no chão e as Divisórias ao redor para limitar a área de jogo.\r\n3. Coloque um Portão de time em cada lado para cada time. Há quatro deles: azul, vermelho, verde e amarelo.\r\n4. Coloque o Cronômetro e os Placares na área de jogo.\r\n5. Quando estiver tudo pronto, chame seus amigos e posicione-se.\r\n6. Clique no Cronômetro para começar o jogo.|'),
(912443, 912419, 4, 'Como jogar Freeze', 42, '1', '1', 0, 1, '', 'pets2', 'catalog_freeze_en|', 'Descubra aqui como criar sua arena FREEZE e organizar seus jogos!|Aqui você descobra tudo sobre o FREEZE!|1.  Vá para seu Quarto\n2.   Coloque pisos e blocos de gelo FREEZE! no chão e utilize muros para definir sua Arena. Sempre coloque blocos de gelo em cima dos pisos.\n3.   Adicione para cada time um portão no seu Quarto. Você pode ter até quatro times: azul, vermelho, amarelo e verde.\n4.   Coloque o relógio e os placares na Arena.\n5.   Por último, coloque uma Saída de Arena em algum lugar do seu Quarto. Este será o lugar para onde os jogadores irão quando acabarem suas vidas.\n6.   Pronto? Agora chame seus amigos e divida-os em equipes. Cada equipe pode ter até cinco jogadores.\n7.   Clique no Relógio e FREEZE-se!|Lembre-se: sempre coloque um Bloco de Gelo FREEZE em cima de um piso. Caso contrário o jogo não irá funcionar!'),
